import dummy from '../dummy';
import Question from './Question';
import { useState, useEffect } from 'react';

const Questions = () => {

    return (
        <>
            <div>
                All Questions
            </div>
            <div>
                {dummy.length} questions
            </div>
            <div>
                {dummy.map((post, idx) => {
                    return <Question key={idx} post={post}></Question>
                })}
            </div>
        </>
    )
};

export default Questions;
